#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 2)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[15];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(rnn_s(gru_cell_s(&gru_gru_cell_config), &gru_config), layer[0]);
	layer[2] = model.hook(rnn_s(gru_cell_s(&gru_1_gru_cell_config), &gru_1_config), layer[1]);
	layer[3] = model.hook(rnn_s(gru_cell_s(&gru_2_gru_cell_config), &gru_2_config), layer[2]);
	layer[4] = model.mergex(concat_s(&concatenate_config), 3 ,layer[1] ,layer[2] ,layer[3]);
	layer[5] = model.hook(rnn_s(gru_cell_s(&gru_3_gru_cell_config), &gru_3_config), layer[4]);
	layer[6] = model.mergex(concat_s(&concatenate_1_config), 3 ,layer[1] ,layer[5] ,layer[3]);
	layer[7] = model.hook(rnn_s(gru_cell_s(&gru_4_gru_cell_config), &gru_4_config), layer[6]);
	layer[8] = model.hook(flatten_s(&flatten_1_config), layer[7]);
	layer[9] = model.hook(flatten_s(&flatten_config), layer[3]);
	layer[10] = model.hook(dense_s(&dense_1_config), layer[8]);
	layer[11] = model.hook(dense_s(&dense_config), layer[9]);
	layer[12] = model.active(act_hard_sigmoid(DENSE_1_OUTPUT_DEC), layer[10]);
	layer[13] = model.hook(output_s(&output1_config), layer[11]);
	layer[13] = model.active(act_hard_sigmoid(DENSE_OUTPUT_DEC), layer[11]);
	layer[14] = model.hook(output_s(&output0_config), layer[12]);
	model_compile(&model, layer[0], layer[14]);
	return &model;
}
